__host__ __device__ void _SHA256(uint8_t* pt, uint64_t ptLen, uint8_t* digest)
{
    SHA256_INFO info;
    _SHA256_init(&info);
    _SHA256_process(pt, ptLen, &info);
    _SHA256_final(&info, digest);
}
