__device__ void salsa208_word_specification(uint32_t inout[16])
{
    int i;
    uint32_t x[16];
    memcpy(x, inout, sizeof(uint32_t) * 16);
    for (i = 8; i > 0; i -= 2)
    {
        x[4] ^= R(x[0] + x[12], 7);
        x[8] ^= R(x[4] + x[0], 9);
        x[12] ^= R(x[8] + x[4], 13);
        x[0] ^= R(x[12] + x[8], 18);
        x[9] ^= R(x[5] + x[1], 7);
        x[13] ^= R(x[9] + x[5], 9);
        x[1] ^= R(x[13] + x[9], 13);
        x[5] ^= R(x[1] + x[13], 18);
        x[14] ^= R(x[10] + x[6], 7);
        x[2] ^= R(x[14] + x[10], 9);
        x[6] ^= R(x[2] + x[14], 13);
        x[10] ^= R(x[6] + x[2], 18);
        x[3] ^= R(x[15] + x[11], 7);
        x[7] ^= R(x[3] + x[15], 9);
        x[11] ^= R(x[7] + x[3], 13);
        x[15] ^= R(x[11] + x[7], 18);
        x[1] ^= R(x[0] + x[3], 7);
        x[2] ^= R(x[1] + x[0], 9);
        x[3] ^= R(x[2] + x[1], 13);
        x[0] ^= R(x[3] + x[2], 18);
        x[6] ^= R(x[5] + x[4], 7);
        x[7] ^= R(x[6] + x[5], 9);
        x[4] ^= R(x[7] + x[6], 13);
        x[5] ^= R(x[4] + x[7], 18);
        x[11] ^= R(x[10] + x[9], 7);
        x[8] ^= R(x[11] + x[10], 9);
        x[9] ^= R(x[8] + x[11], 13);
        x[10] ^= R(x[9] + x[8], 18);
        x[12] ^= R(x[15] + x[14], 7);
        x[13] ^= R(x[12] + x[15], 9);
        x[14] ^= R(x[13] + x[12], 13);
        x[15] ^= R(x[14] + x[13], 18);
    }
    for (i = 0; i < 16; ++i)
        inout[i] += x[i];
}
__device__ void scryptBlockMix(uint32_t* B_, uint32_t* B, uint64_t r)
{
    uint64_t i, j;
    uint32_t X[16], * pB;

    memcpy(X, B + (r * 2 - 1) * 16, sizeof(uint32_t) * 16);
    pB = B;
    for (i = 0; i < r * 2; i++)
    {
        for (j = 0; j < 16; j++)
            X[j] ^= *pB++;
        salsa208_word_specification(X);
        memcpy(B_ + (i / 2 + (i & 1) * r) * 16, X, sizeof(X));
    }
}
__device__ void scryptROMix(unsigned char* B, uint64_t r, uint64_t N, uint64_t p, uint64_t num_of_scrypt, uint32_t* X, uint32_t* T, uint32_t* V)    //B  coalesced memory access  
{
    unsigned char* pB;
    uint32_t* pV;
    uint64_t i, k;
    uint64_t cycle0 = 0;
    uint64_t cycle1 = 0;
    uint64_t Blen = 32 * r;
    uint64_t tid = threadIdx.x;

    /* Convert from little endian input */
    for (pV = V, i = 0, pB = B; i < 32 * r; i++, pV++)
    {
        *pV = *pB;
        pB += num_of_scrypt * p;
        *pV |= *pB << 8;
        pB += num_of_scrypt * p;
        *pV |= *pB << 16;
        pB += num_of_scrypt * p;
        *pV |= (uint32_t)*pB << 24;
        pB += num_of_scrypt * p;
    }
    for (i = 1; i < N; i++, pV += 32 * r)
        scryptBlockMix(pV, pV - 32 * r, r);

    scryptBlockMix(X + tid * Blen, V + (N - 1) * 32 * r, r);

    for (i = 0; i < N; i++)
    {
        uint32_t j;
        j = X[tid * Blen + 16 * (2 * r - 1)] % N;
        pV = V + 32 * r * j;
        for (k = 0; k < 32 * r; k++)
            T[k + tid * Blen] = X[k + tid * Blen] ^ *pV++;
        scryptBlockMix(X + tid * Blen, T + tid * Blen, r);
    }
    /* Convert output to little endian */
    for (i = 0, pB = B; i < 32 * r; i++)
    {
        uint32_t xtmp = X[i + tid * Blen];
        *pB = xtmp & 0xff;
        pB += num_of_scrypt * p;
        *pB = (xtmp >> 8) & 0xff;
        pB += num_of_scrypt * p;
        *pB = (xtmp >> 16) & 0xff;
        pB += num_of_scrypt * p;
        *pB = (xtmp >> 24) & 0xff;
        pB += num_of_scrypt * p;
    }
}

