{
    uint64_t Blen, j;
    uint64_t tid = blockDim.x * blockIdx.x + threadIdx.x;
    uint64_t num_of_scrypt = gridDim.x;

    Blen = 128 * r * p * gridDim.x;

    __shared__ uint32_t X[32 * 8 * USE_P]; //  8 r ->  B  block  
