    cudaEventCreate(&start);
    cudaEventCreate(&stop);
    cudaEventRecord(start, 0);

    for (int i = 0; i < blocksize; i++)
    {
        PBKDF2_HMAC_SHA256_coalesced(host_password + GPU_PASSWORD_LEN * i, GPU_PASSWORD_LEN, host_salt + GPU_SALT_LEN * i, GPU_SALT_LEN, cpu_block + i * threadsize, Blen, 1, threadsize, blocksize);
    }

    cudaMemcpy(gpu_b, cpu_block, Blen * blocksize, cudaMemcpyHostToDevice);   //gpu_b cpu_block  PBKDF2   (blocksize scrypt     )

    GPU_scrypt_first_method << <blocksize, threadsize >> > (gpu_b, gpu_V, 1024, 8, threadsize);

    cudaMemcpy(cpu_block, gpu_b, Blen * blocksize, cudaMemcpyDeviceToHost);

    for (int i = 0; i < blocksize; i++)
    {
        PBKDF2_HMAC_SHA256_coalesced2(host_password + (GPU_PASSWORD_LEN * i), GPU_PASSWORD_LEN, cpu_block + (threadsize * i), Blen, cpu_key + (64 * i), 64, 1, threadsize, blocksize);
    }

    cudaEventRecord(stop, 0);
    cudaDeviceSynchronize();
    cudaEventSynchronize(start);
    cudaEventSynchronize(stop);
    cudaEventElapsedTime(&elapsed_time_ms, start, stop);
    printf("%4.2f\n", elapsed_time_ms);

#if PRINT == 1
    for (int i = 0; i < 64 * blocksize; i++)
    {
        printf("%02X ", cpu_key[i]);
        if ((i + 1) % 16 == 0)
            printf("\n");
        if ((i + 1) % 64 == 0)
            printf("\n");
    }
#endif

    printf("first method's <<<%d, %d>>> scrypt per second is : %4.2f\n", blocksize, threadsize, (1000 / elapsed_time_ms) * blocksize);

    cudaFree(gpu_b);
    cudaFree(gpu_key);
    cudaFree(gpu_V);
    free(cpu_key);
    free(cpu_block);
}

