    printf("second method's <<<%d, %d>>> scrypt per second is : %4.2f\n", blocksize, threadsize, 1000 / elapsed_time_ms * blocksize);

    cudaFree(gpu_b);
    cudaFree(gpu_key);
    free(cpu_key);
